import React,{useState} from "react";
import { useHistory } from "react-router-dom";
import logo_everis from "../Static/Img/images/logo-everis.png";
import PersonIcon from "@material-ui/icons/Person";
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
const axios = require("axios");

export const NavbarComponent = () => {
    const [openMenu, setOpenMenu] = useState(false);
  let history = useHistory();
  return (
    <>
      <nav
        class="navbar is-transparent"
        role="navigation"
        aria-label="main navigation"
      >
        <div class="navbar-brand">
          <div class="navbar-item">
            <figure class="image is-48x48">
              <img alt="" src={logo_everis} />
            </figure>
            <h3>Business Development</h3>
          </div>
        </div>

        <div class="navbar-end">
          <div class="navbar-item">
            <div class="buttons">
              <Button onClick={setOpenMenu(true)}><PersonIcon /> {sessionStorage.getItem("username").toUpperCase()}</Button>
              <Menu
                id="simple-menu"
                keepMounted
                open={openMenu}
                onClose={setOpenMenu(false)}
              >
                <MenuItem  onClick={() =>
                  axios
                    .get(
                      `${
                        process.env.REACT_APP_API_ROOT_URL
                      }/oauth/revoke-token/${sessionStorage.getItem(
                        "username"
                      )}`,
                      {
                        headers: {
                          "Content-Type": "application/json",
                          Authorization:
                            "Bearer " + sessionStorage.getItem("user_token"),
                        },
                      }
                    )
                    .then(function (response) {
                      // handle success
                    })
                    .catch(function (error) {
                      // handle error
                    })
                    .finally(function () {
                      // always executed
                      sessionStorage.removeItem("user_token");
                      history.push("/");
                    })
                }>Logout</MenuItem>
              </Menu>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
};

export default NavbarComponent;
